import React from "react";
import "./TodoList.scss";

const TodoList = ({ todos }) => {
  return (
    <div className="listBox">
      <ul>
        {TodoList.map((el) => {
          return <li>{el.label}</li>;
        })}
        <li>Test</li>
        <li>Test</li>
        <li>Test</li>
      </ul>
    </div>
  );
};

export default TodoList;
